import { Injectable } from '@angular/core';
import { HttpClient, HttpHeaders, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';
import { User } from 'src/app/models/User';

@Injectable({
  providedIn: 'root'
})
export class UserbackService {

  private apiUrl = 'https://localhost:7129/api/Users';

  constructor(private http: HttpClient) { }

  addUser(user: User): Observable<HttpResponse<any>> {
    return this.http.post<any>(`${this.apiUrl}/addUser`, user, { observe: 'response' });
  }

  getUsers(): Observable<User[]> {
    console.log(this.http.get<User[]>(this.apiUrl));
        return this.http.get<User[]>(this.apiUrl);
  }
}
